import React from 'react';
import{
    Image,
    Text,
View
} from 'react-native';
import {icons} from '../constants';
const Header = ()=>{
    return(
        <View>
            <View style={{justifyContent:'center',alignSelf:'center',padding:15}}>
                <Image 
                source={icons.biome}
                style={{
                    width:150,
                    height:68
                }}
                />
            </View>
        </View>

    )
}
export default Header;
